import React from "react";
import PriceRangeBarChart from "./PriceRangeBarChart";

const BarChartData = ({ priceranges }) => {
  return (
    <div>
      <h2>Price Ranges</h2>
      <ul>
        {Object.entries(priceranges || {}).map(([range, count]) => (
          <li key={range}>
            {range}: {count}
          </li>
        ))}
      </ul>

      <h2>Price Range Bar Chart</h2>
      <PriceRangeBarChart priceRanges={priceranges} />
    </div>
  );
};

export default BarChartData;
